import React, { Component } from "react";

interface Props {
    title : string;
    author : string;
    pages : string;
};

interface State {
};


class BookDescription extends Component<Props,State> {

    constructor(props : Props) {
        super(props);
    }
          
    render() {    
        return (
            <div >
                <p>Tytu≈Ç: {this.props.title}</p>
                <p>Autor: {this.props.author}</p>
                <p>Liczba stron: {this.props.pages}</p>
                <hr />
            </div>
        );
    }   
}

export default BookDescription;
